import React from 'react';

const AddUser = props => {
    const addUserHandler = (event) =>  {
        event.preventDefault();
    };
    return(
    <form onSubmit={addUserHandler}>
        <label htmlFor="user">Username</label>
        <input id="user" />
        <label htmlFor="add">Username</label>
        <input id="add" />
    </form>
    );
};

export default AddUser;
